import React, { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { toast } from "react-toastify";
import { createUrl, log } from "../../utils/utils";
import { getPatientById } from "../../services/user";
import { Link } from 'react-router-dom';
import { useEffect } from "react";

const ServiceBook = () => {
  const { id, name } = useParams();
  // const [description, setDescription] = useState("");
  // const [carId, setCarId] = useState("");
  const [patient, setPatient] = useState([]);
  const navigate = useNavigate();

  const services = [
    { id: 1, option: 'Edit Profile' }
  ];

  useEffect(() => {
    getPatient();
  }, [])
  const getPatient = async () => {
    try {
      const patientId = sessionStorage.getItem("userId");
      console.log(patientId);
      const response = await getPatientById(patientId);
      console.log(response);
      setPatient(response);
    } catch (error) {
      console.error(error);
      toast.error("An error occurred during getching patient");
    }
  };

  const Back = ()=>{
    navigate('/PatientServices');
}

  return (
    <div class="container">
      <div class="row">
        <div class="col"></div>
        <div class="col">
          <div class="form">
            <h1>Your Profile</h1>
            <div class="mb-3">
              <div class="table-responsive">
                <table class="table">
                  <tbody>
                    <tr>
                      <td colSpan="1"> Name:</td>
                      <td>{patient.pname} </td>
                    </tr>
                    <tr>
                      <td>Email: </td>
                      <td>{patient.email}</td>
                    </tr>
                    <tr>
                      <td>Password:</td>
                      <td>{patient.password} </td>
                    </tr>
                    <tr>
                      <td>Contact No: </td>
                      <td>{patient.pcontactNo}</td>
                    </tr>
                    <tr>
                      <td>Age: </td>
                      <td>{patient.page}</td>
                    </tr>
                    <tr>
                      <td>Address: </td>
                      <td>{patient.paddress}</td>
                    </tr>
                    <tr>
                      <td>BloodGroup: </td>
                      <td>{patient.pbloodGroup}</td>
                    </tr>

                    <tr></tr>
                  </tbody>
                </table>
              </div>
            </div>

            {/* <button type="submit" class="btn btn-success" onClick={getPatient}>
              Submit
            </button> */}
          </div>
          <ul className='services-list'>
            {services.map((service) => (
              <li key={service.id} className='service-box'>
                <div className="service-content">
                </div>
                <Link

                  to={{
                    pathname: `/patientEdit/${sessionStorage.getItem("userId")}`,
                    state: { serviceData: service }
                  }}
                  className="btn btn-primary"
                >
                  {service.option}
                </Link>
              </li>
            ))}
          </ul>
        </div>
        <div class="col"></div>
        <div >
          <button className='btn btn-primary' 
            onClick={Back}>
            Back
           </button>
        </div>
      </div>
    </div>
  );
};

export default ServiceBook;

